import React from 'react';

const User = () => {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center' }}>
        <h1>Cadastro</h1>

        <div style={{ 
          display: 'flex', 
          flexDirection: 'column',
          width: '40vw' 
        }}>
          <input 
            style={{
              marginBottom: '20px'
            }}
            type="text" 
          />
          <input 
            style={{
              marginBottom: '20px'
            }}
            type="email" 
          />
          <input
            style={{
              marginBottom: '20px'
            }} 
            type="password" 
          />
        </div>
    </div>
  );
}

export default User;
